    require(newRouter != address(0), "Invalid router address");
    require(msg.sender == manager, "Manageable: caller is not the manager");

    // Check if the new router address is a contract
    require(newRouter.code.length > 0, "Router address is not a contract");

    // Verify the router has a factory() function
    (bool factorySuccess, bytes memory factoryData) = newRouter.staticcall(abi.encodeWithSignature("factory()"));
